import { NavWrap, NavItem } from "./Nav.styles";

function Nav(props) {
    const { menu } = props;
    console.log(menu);

    return(
        <NavWrap>
            <NavItem>{'item.title'}</NavItem>
            {menu.map(item => {
                console.log(item.title);
                <NavItem>{item.title}</NavItem>
            })}
        </NavWrap>
    );
}

export default Nav;
